import './HomePage.css'
// import { Link } from 'react-router-dom'
import NavBar from '../NavBar/NavBar'
import { useState, useEffect } from 'react'
import axios from 'axios'
// import axios from '../../../axios'

const URL = "https://api.thedogapi.com/v1/breeds"
// const URL_IMG = "https://cdn2.thedogapi.com/images/"
const HomePage = () =>  {
    const [dogs, setDogs] = useState([])

    useEffect(() => {
        const fetchDogs = async () => {
         try {
            const {data} = await axios.get(`${URL}`)

            setDogs(data)

        }catch (error){
            return "MAL AHI"
            // return res.status(404).send(error.message)
        }
    }
    fetchDogs() 
},[])

const truncer = (string, n) => {
    return string?.length > n ? string.substr(0, n - 1) + '...' : string;
}

return (
        <div className="home_general">
            <NavBar />
            <div className='title_landing'>
            <h1>PI Dogs Henry</h1>
            </div>
            <div className='home_cards'>
                {
                    dogs.map((dog) => (
                      <div className='article' key={dog.id}>
                        <img src={'https://cdn2.thedogapi.com/images/BJa4kxc4X.jpg'} alt={dog.name} />
                        <h2>{dog.name}</h2>
                        <p>{truncer(dog?.temperament, 30)}</p>
                        {/* <p>{dog.weight}</p> */}
                      </div>  
                    ))
                }
            </div>
            <button type="button" class="arrow-button" href="pagina-siguiente.html">
                <i class="fas fa-arrow-right"></i>
            </button>
        </div>
    )
}

export default HomePage
